import React from 'react';
import { Card, Button } from 'react-bootstrap';

const Team = (props) => {
    const { strAlternate, strCountry, strTeamBadge } = props.teams;
    const styleTeam = {
        border: '2px solid red',
        margin: '10px',
        borderRadius: '20px'

    }
    return (

        <div style={styleTeam} className="col-md-3 my-3">

            <Card style={{ width: '18rem' }}>

            
            
            

                <Card.Body>
                <img style={{width:'150px'}} src={strTeamBadge} alt=""/>
                    <Card.Title>Name:{strAlternate}</Card.Title>
                    <Card.Subtitle className="mb-2 text-muted">Country:{strCountry}</Card.Subtitle>
                    <Button variant="primary">Primary</Button>{' '}
                    
                </Card.Body>
            </Card>

        </div>
    );
};

export default Team;
